export const resolveDoctor = (doctor: Doctor): ResolvedDoctor => ({
  ...doctor,
  specialties: doctor.specialty_ids.map(id => lookups.specialties[id]),
  cities: doctor.city_ids.map(id => lookups.cities[id]),
  diseases: doctor.disease_ids.map(id => lookups.diseases[id]),
});

export const getDoctorBySlug = (slug: string): ResolvedDoctor | null => {
  const doc = doctors.find(d => d.slug === slug);
  return doc ? resolveDoctor(doc) : null;
};
